import { Component } from 'react';
import axios from 'axios';
import raw from '../Data/failas.txt';

export class ListOfListings extends Component {

    constructor(props){
        super(props);
        this.state = {
            listings: []
        }
    }

    tempListings = [ "listing1", "listing2"];

    componentDidMount()
    {
        var strs;
        var arrobj;
        fetch(raw)
            .then(r => r.text())
            .then(text => {
                let buffer = text;
                strs = buffer.split('\n');
                console.log('array is', strs);
                arrobj = strs.map(str => JSON.parse(str));
                console.log('arrayobj is', arrobj);
                this.state.listings = arrobj;
                console.log('listings is', this.state.listings);
            });
        console.log('listings is', this.state.listings);
        
    }

    render()
    {
        return (

            <ul>
                {
                    this.tempListings
                        .map((tempListing, index) =>
                            <li key={index}>
                                { tempListing }
                            </li>
                        )
                }
            </ul>
        );
    }


}
